import{_ as t,a,b as r,c as i,d as o,e as n,f as l,g as s}from"./chunks/qgc_actuator_config.BvvOaiEq.js";import{_ as h,c as g,a8 as c,o as d}from"./chunks/framework.BDnHobkS.js";const x=JSON.parse('{"title":"Wing Wing Z-84 Pixracer Build","description":"","frontmatter":{},"headers":[],"relativePath":"zh/frames_plane/wing_wing_z84.md","filePath":"zh/frames_plane/wing_wing_z84.md"}'),p={name:"zh/frames_plane/wing_wing_z84.md"};function u(m,e,f,b,_,w){return d(),g("div",null,e[0]||(e[0]=[c('<h1 id="wing-wing-z-84-pixracer-build" tabindex="-1">Wing Wing Z-84 Pixracer Build <a class="header-anchor" href="#wing-wing-z-84-pixracer-build" aria-label="Permalink to &quot;Wing Wing Z-84 Pixracer Build&quot;">​</a></h1><p>The Wing Wing Z-84 is a flying wing frame. It is small, rugged and just large enough to host a <a href="./../flight_controller/pixracer.html">Pixracer</a>.</p><p>Key information:</p><ul><li><strong>Frame:</strong> Wing Wing Z-84</li><li><strong>Flight controller:</strong> Pixracer</li></ul><p><img src="'+t+'" alt="Wing Wing Z-84 build"></p><h2 id="配件列表" tabindex="-1">配件列表 <a class="header-anchor" href="#配件列表" aria-label="Permalink to &quot;配件列表&quot;">​</a></h2><h3 id="z-84-plug-n-fly-pnf-pnp-or-kit" tabindex="-1">Z-84 Plug n&#39; Fly (PNF/PNP) or Kit <a class="header-anchor" href="#z-84-plug-n-fly-pnf-pnp-or-kit" aria-label="Permalink to &quot;Z-84 Plug n&#39; Fly (PNF/PNP) or Kit&quot;">​</a></h3><p>One of these:</p><ul><li><a href="https://www.banggood.com/Wing-Wing-Z-84-Z84-EPO-845mm-Wingspan-Flying-Wing-PNP-p-973125.html" target="_blank" rel="noreferrer">Banggood</a></li><li><a href="https://hobbyking.com/en_us/wing-wing-z-84-epo-845mm-kit.html" target="_blank" rel="noreferrer">Hobbyking US Warehouse</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>PNF (or &quot;PNP&quot;) versions include motor, propeller and electronic speed controller. The &quot;kit&quot; version does not include these components, which must be purchased separately.</p></div><h3 id="electronic-speed-controller-esc" tabindex="-1">Electronic Speed Controller (ESC) <a class="header-anchor" href="#electronic-speed-controller-esc" aria-label="Permalink to &quot;Electronic Speed Controller (ESC)&quot;">​</a></h3><p>One of these (any small (&gt;=12A) ESC will do):</p><ul><li><a href="https://hobbyking.com/en_us/turnigy-20a-brushed-esc.html" target="_blank" rel="noreferrer">Turnigy 20A Brushed ESC ESC</a> (Hobbyking)</li><li><a href="https://www.getfpv.com/lumenier-30a-blheli-s-esc-opto-2-4s.html" target="_blank" rel="noreferrer">Lumenier Regler 30A BLHeli_S ESC OPTO</a> (GetFPV)</li></ul><h3 id="autopilot-and-essential-components" tabindex="-1">Autopilot and Essential Components <a class="header-anchor" href="#autopilot-and-essential-components" aria-label="Permalink to &quot;Autopilot and Essential Components&quot;">​</a></h3><ul><li><a href="./../flight_controller/pixracer.html">Pixracer</a> kit (including GPS and power module)</li><li>FrSky D4R-II receiver or equivalent (jumpered to PPM sum output according to its manual)</li><li><a href="./../flight_controller/pixfalcon.html#availability">Mini telemetry set</a> for Holybro pix32</li><li><a href="./../flight_controller/pixfalcon.html#availability">Digital airspeed sensor</a> for Holybro pix32 / Pixfalcon</li><li>1800 mAh 2S LiPo Battery - e.g. <a href="https://teamorion.com/en/batteries-en/lipo/soft-case/team-orion-lipo-1800-2s-7-4v-50c-xt60-en/" target="_blank" rel="noreferrer">Team Orion 1800mAh 7.4V 50C 2S1P</a></li></ul><h3 id="recommended-spare-parts" tabindex="-1">Recommended spare parts <a class="header-anchor" href="#recommended-spare-parts" aria-label="Permalink to &quot;Recommended spare parts&quot;">​</a></h3><ul><li>1 cm diameter O-ring for prop saver (<a href="https://hobbyking.com/en_us/wing-wing-z-84-o-ring-10pcs.html" target="_blank" rel="noreferrer">Hobbyking</a>)</li><li>125x110 mm propellers (<a href="https://hobbyking.com/en_us/gws-ep-propeller-dd-5043-125x110mm-green-6pcs-set.html" target="_blank" rel="noreferrer">Hobbyking</a>)</li></ul><h2 id="布线" tabindex="-1">布线 <a class="header-anchor" href="#布线" aria-label="Permalink to &quot;布线&quot;">​</a></h2><p>Wire the servos and motors as shown. Use the <code>MAIN</code> outputs (not the ones labeled with AUX). The motor controller needs to have an in-built BEC, as the autopilot is not powering the servo rail.</p><table tabindex="0"><thead><tr><th>Port</th><th>接口定义</th></tr></thead><tbody><tr><td>RC IN</td><td>PPM or S.BUS / S.BUS2 input</td></tr><tr><td>MAIN 1</td><td>Left Aileron</td></tr><tr><td>MAIN 2</td><td>Right Aileron</td></tr><tr><td>MAIN 3</td><td>空</td></tr><tr><td>MAIN 4</td><td>Motor 1</td></tr></tbody></table><h2 id="build-log" tabindex="-1">Build Log <a class="header-anchor" href="#build-log" aria-label="Permalink to &quot;Build Log&quot;">​</a></h2><p>The images below give a rough idea about the assembly process, which is simple and can be done with a hot glue gun.</p><p><img src="'+a+'" alt="wing wing build01"><img src="'+r+'" alt="wing wing build02"><img src="'+i+'" alt="wing wing build03"><img src="'+o+'" alt="wing wing build04"><img src="'+n+'" alt="wing wing build09"><img src="'+t+'" alt="Wing Wing Z-84 build"></p><h2 id="px4-配置" tabindex="-1">PX4 配置 <a class="header-anchor" href="#px4-配置" aria-label="Permalink to &quot;PX4 配置&quot;">​</a></h2><h3 id="airframe-configuration" tabindex="-1">Airframe Configuration <a class="header-anchor" href="#airframe-configuration" aria-label="Permalink to &quot;Airframe Configuration&quot;">​</a></h3><p>Select <strong>Flying Wing &gt; Generic Flying Wing</strong> in the QGroundControl <a href="./../config/airframe.html">Airframe Configuration</a>:</p><p><img src="'+l+'" alt="QGC - select firmware for West Wing"></p><h3 id="actuator-mapping" tabindex="-1">Actuator Mapping <a class="header-anchor" href="#actuator-mapping" aria-label="Permalink to &quot;Actuator Mapping&quot;">​</a></h3><p>Set up the <a href="./../config/actuators.html">Actuator Configuration</a> to match the wiring for the ailerons and throttle as <a href="#wiring">indicated above</a>.</p><p><img src="'+s+'" alt="QGC - set the actuators"></p><h3 id="other-configuration" tabindex="-1">Other Configuration <a class="header-anchor" href="#other-configuration" aria-label="Permalink to &quot;Other Configuration&quot;">​</a></h3><p>Perform all the the other <a href="./../config/">Basic Configuration</a>, including <a href="./../config/autotune_fw.html">Autotuning</a>.</p><p>Advanced tuning is optional - see <a href="./../config_fw/">Fixed-wing Vehicle Configuration</a>.</p>',33)]))}const y=h(p,[["render",u]]);export{x as __pageData,y as default};
